import { Provider } from "react-redux";
import { styled } from "styled-components";
import { configureStore } from "@reduxjs/toolkit";
import { BrowserRouter, Route, Routes } from "react-router-dom"
import Main from "./pages/Main";
import InGame from "./pages/InGame";
import backgroundColor from "./assets/images/interfaces/backgroundColor.svg"
import backgroundField from "./assets/images/interfaces/backgroundField.svg"

const LeftBorder = styled.div`
  background-color: black;
  position: fixed;
  left: 0;
  top: 0;
  width: 10%;
  height: 100%;
  z-index: 3;
`;
const RightBorder = styled.div`
  background-color: black;
  position: fixed;
  right: 0;
  top: 0;
  width: 10%;
  height: 100%;
  z-index: 3;
`;
const BackGround = styled.img`
  position: absolute;
  left: 0;
  bottom: 0;
  width:3735px;
  z-index: 0;
`;

const store = configureStore({
  reducer:{
      // unit:unit.reducer,
      // menu:menu.reducer,
      // tower:tower.reducer,
      // status:status.reducer,
      // load:load.reducer,
      // unitData:unitData.reducer,
      // selectTurret:selectTurret.reducer,
      // attacks:attacks.reducer
  }
})

function App() {

  return (
    <BrowserRouter>
      <Provider store={store}>
        <LeftBorder></LeftBorder>
        <BackGround src={backgroundColor}></BackGround>
        <BackGround src={backgroundField}></BackGround>
        <RightBorder></RightBorder>
        <Routes>
            <Route path="/" element={<Main />}></Route>
            <Route path="/InGame" element={<InGame />}></Route>
        </Routes>
      </Provider>
    </BrowserRouter>
    );
}

export default App;
